  [],\n\t\"revision_timestamp\": \"2016-07-27T22:23:47.869025\",\n\t\"name\": \"crane-meadows-national-wildlife-refuge-comprehensive-conservation-plan\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Crane Meadows NWR for the next 15 years. This
  plan outlines the Refuge vision and purpose and describes how Crane Meadows NWR
  will contribute to the overall mission of the Refuge System. The plan provides an
  introduction to the Refuge, an overview of the CCP process, information about the
  Refuge environment and management, a summary of the management direction, and strategies
  for implementation. Key planning issues include: habitat, land acquisition, water
  resources, wildlife, visitor services, and cultural resources.\",\n\t\"license_title\":
